// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

import "../interfaces/IController.sol";
import "../interfaces/IUniswapV2Router02.sol";
import "./openzeppelin/contracts/token/ERC20/SafeERC20.sol";


/**
* @title Corn Finance Gelato Resolver
* @author C.W.B.
*
* @notice When resolver contracts are called, the returned data is used as the
* input data on a seperate call. This means that the call to the resolver contract
* does not affect the gas used on the 'fillOrderGelato()' call.
*
* This resolver contract is used for finding the best swap path across numerous
* Uniswap V2 Routers. Paths will be either:
*   a.) from token --> to token
*   b.) from token --> connector token --> to token
* The best path and router are then encoded with the respective order data. The
* encoded data is used as input data for 'fillOrderGelato()' in the Controller
* contract.
*/
contract Resolver {
    using SafeMath for uint256;

    IUniswapV2Router02[] public routers = [
        IUniswapV2Router02(0xa5E0829CaCEd8fFDD4De3c43696c57F7D7A678ff), // Quickswap
        IUniswapV2Router02(0x1b02dA8Cb0d097eB8D57A175b88c7D8b47997506), // Sushiswap
        IUniswapV2Router02(0x94930a328162957FF1dd48900aF67B5439336cBD), // Polycat
        IUniswapV2Router02(0xC0788A3aD43d79aa53B09c2EaCc313A787d1d607), // ApeSwap
        IUniswapV2Router02(0xA102072A4C07F06EC3B4900FDC4C7B80b6c57429), // Dfyn
        IUniswapV2Router02(0x3a1D87f206D12415f5b0A33E786967680AAb4f6d)  // WaultSwap
    ];
    address[] public connectorTokens = [
        0x8f3Cf7ad23Cd3CaDbD9735AFf958023239c6A063, // DAI
        0x2791Bca1f2de4661ED88A30C99A7a9449Aa84174, // USDC
        0x0d500B1d8E8eF31E21C99d1Db9A6444d3ADf1270, // WMATIC
        0x7ceB23fD6bC0adD59E62ac25578270cFf1b9f619, // WETH
        0xc2132D05D31c914a87C6611C10748AEb04B58e8F, // USDT
        0x831753DD7087CaC61aB5644b308642cc1c33Dc13  // QUICK
    ];

    // --------------------------------------------------------------------------------

    /**
    * @dev Gelato executor will call this function before calling 'fillOrderGelato()'
    * in the Controller contract.
    * @param _vaultId: Vault that holds the order
    * @param _orderId: Order to fill
    * @param _fromToken: ERC20 token being swapped
    * @param _toToken: ERC20 token received from swap
    * @param _fromAmount: Amount of '_fromToken' going into the swap
    * @return (true: Gelato executor call 'fillOrderGelato()'; false: Gelato executor 
    * will not call 'fillOrderGelato()', Input data for 'fillOrderGelato()')
    */
    function checker(
        uint256 _vaultId, 
        uint256 _orderId, 
        address _fromToken, 
        address _toToken, 
        uint256 _fromAmount
    ) public view returns (bool, bytes memory) {
        // Find the best Uniswap V2 router and path for swapping tokens
        (address router, address[] memory path, ) = findBestPath(_fromToken, _toToken, _fromAmount);

        // Encode input data for when the Gelato executor calls 'fillOrderGelato()'
        return (
            true, 
            abi.encodeWithSelector(
                IController.fillOrderGelato.selector, 
                _vaultId, 
                _orderId, 
                router, 
                path
            )
        );
    }

    // --------------------------------------------------------------------------------

    /**
    * @param _fromToken: ERC20 token being swapped
    * @param _toToken: ERC20 token received from swap
    * @param _amountIn: Amount of '_fromToken' going into the swap 
    */
    function findBestPath(
        address _fromToken, 
        address _toToken, 
        uint256 _amountIn
    ) public view returns (address, address[] memory, uint256) {
        uint256 bestAmountOut = 0;
        address bestRouter;
        address bestConnectorToken;

        address fromToken = _fromToken;
        address toToken = _toToken;
        uint256 amountIn = _amountIn;

        // Loop through all of the routers
        for(uint i = 0; i < routers.length; i++) {
            // Loop through all of the connector tokens
            for(uint j = 0; j < connectorTokens.length; j++) {
                // Connector token, 'from' token, and 'to' token must be unique
                address connectorToken = fromToken == connectorTokens[j] || toToken == connectorTokens[j] ? address(0) : connectorTokens[j];

                // Get the 'to' amount from the swap
                uint256 amountOut = getAmountOut(
                    routers[i], 
                    amountIn, 
                    fromToken, 
                    connectorToken, 
                    toToken
                );

                // Current router and path produce the most amount out yet
                if(amountOut > bestAmountOut) {
                    bestAmountOut = amountOut;
                    bestRouter = address(routers[i]);
                    bestConnectorToken = connectorToken;
                }
            }
        }

        address[] memory bestPath;

        // No connector token. Path is only 'from' token and 'to' token
        if(bestConnectorToken == address(0)) {
            bestPath = new address[](2);
            bestPath[0] = fromToken;
            bestPath[1] = toToken;
        }

        // Path has connector token
        else {
            bestPath = new address[](3);
            bestPath[0] = fromToken;
            bestPath[1] = bestConnectorToken;
            bestPath[2] = toToken;
        }
        return (bestRouter, bestPath, bestAmountOut);
    }

    // --------------------------------------------------------------------------------

    /**
    * @param _router: Router used to perform a swap
    * @param _amountIn: Amount of '_fromToken' going into the swap
    * @param _fromToken: ERC20 token being swapped
    * @param _connectorToken: ERC20 token that connects the 'from' and 'to' tokens
    * @param _toToken: ERC20 token received from the swap
    * @return Amount of '_toToken' received from the swap
    */
    function getAmountOut(
        IUniswapV2Router02 _router, 
        uint256 _amountIn, 
        address _fromToken, 
        address _connectorToken, 
        address _toToken
    ) public view returns (uint256) {
        address[] memory _path;

        // No connector token. Path is only 'from' token and 'to' token
        if(_connectorToken == address(0)) {
            _path = new address[](2);
            _path[0] = _fromToken;
            _path[1] = _toToken;
        }
        // Path has a connector token
        else {
            _path = new address[](3);
            _path[0] = _fromToken;
            _path[1] = _connectorToken;
            _path[2] = _toToken;
        }

        // Get the 'to' amount from the swap
        try _router.getAmountsOut(_amountIn, _path) returns (uint256[] memory amountsOut) {
            return amountsOut[_path.length.sub(1)];
        }
        // Call reverted
        catch {
            return 0;
        }
    }
}
